import React, { useEffect } from 'react';
import { connect } from 'react-redux';
import { bindActionCreators } from 'redux';
import * as houseActions from '../actions/houseActions';
import Detail from './Detail';
import HiddenNav from './HiddenNav';

const DetailsPage = ({ state, actions }) => {
  useEffect(() => {
    actions.fetchSubscription(0);
  }, []);

  return (
    <div style={{ height: '100%', overflow: 'hidden', pointerEvents: 'none', backgroundColor: '#f7f5fa', zIndex: 1 }}>
    <Detail />
    <HiddenNav />
  </div>
  )
}

function mapStateToProps({ state }) {
  return { state: { ...state } };
}

function mapActionsToProps(dispatch) {
  return {
    actions: bindActionCreators({ ...houseActions }, dispatch),
  };
}

export default connect(mapStateToProps, mapActionsToProps)(DetailsPage);
